import React from 'react'
import styled from 'styled-components'

export const Icon = ({ src, ...refs }) => {
   return (
      <ImageS src={src} alt="cgv" {...refs} />
   )
}

export default Icon

const ImageS = styled.img`
   width:${p => p.width || 50}px;
   height: ${p => p.height || 50}px;
   border-radius: 50%;
`
